INSERT INTO `post` VALUES (1,'Insomnia','insomnia','Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...','Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...','Сет с которого все и началось, впервые был записан в 2004 году, с тех пор собственно ничего не изменилось, кроме качества звука - сет был переигран в 2007 только ради этой цели...',1,'MNT001','Noise, ambient','LAME 192kbps 44100Hz','79:31','1. Http - Звезды небесные\r\n2. I/dex - Zeel\r\n3. Pole 3 - Silbefisch\r\n4. Deep-z - Returning (Dedicated to Fula)\r\n5. I/dex - Ksren\r\n6. Plastikman - Disconnect    \r\n7. Akvalangist - Adpcm\r\n8. Fax - 20w\r\n9. David Alvarado - Aire  \r\n10. Fax - Aslip\r\n11. Deluge - Departure\r\n12. Pole 3 - Uberfahrt\r\n13. Taylor Deupree - Snow-Sand','2005-08-08 00:00:00',6,'2013-04-10 11:49:06'),(2,'Для IT HRs и разработчиков','for-it','Кратко о себе, основные сведения, профессиональные знания и навыки.','<img src=\"/content/images/exec.jpg\" style=\"margin: 0 0 10px 10px\" class=\"fr\" alt=\"Manti\" /><p><strong>Кратко о себе</strong>:</p><p>Высшее техническое образование по специальности инженер-программист со специализацией информационные и интернет технологии.</p><p>Коммуникабельность, умение работать в команде, технический английский, грамотная речь, эмоциональная выдержка, большой опыт общения с клиентами (от пенсионеров до высоких должностных лиц), крепкое здоровье, без вредных превычек.</p><p>Без проблем работаю как на windows платформе, так и на linux/debian платформах. Высокие знания пакета Adobe Photoshop.</p><p><strong>Основные сведения</strong>:</p><ul><li>Более чем 7-летний практический (3-летний коммерческий) опыт разработки web-приложений от стадии постановки задачи до запуска работающего проекта.</li><li>Высоконагруженные приложения со сложной архитектурой и пропускной способностью более чем 5000rps. Горизонтальное и вертикальное масштабирование.</li><li>Знание, понимание и практическое использование ООП. Шаблоны проектирования.</li><li>Грамотное оформление кода (иерархия, описание, комментарии), умение читать и понимать чужой код, в т.ч. и \"плохой\".</li><li>Оптимизация существующего кода: PHP, MySQL (Join / Union / Proc), кеширование (Memcached, FileCache), поиск по большим БД (Sphinx / Solr), HTML / CSS (замена табличной верстки на блочную). Возможно составление технической документации по проекту.</li><li>Администрирование и запуск серверов: XAMPP (WinServer, WinXP/Seven), LAMP (Red Hat, Ubuntu) on Apache / Nginx + PHP (Mod, FCGI, CLI) + Memcached + MySQL / MongoDB + IspManager / Munin; высокий уровень использования Ubuntu shell / bash, опыт работы с AWS.</li><li>Отладка и профилирование кода - xDebug; системы контроля версий - SVN / GIT / Mercurial, ветвление, слияние, откаты и т.п.</li></ul><p> <strong>Профессиональные знания и навыки</strong>:</p><ul><li>Языки программирования: PHP 5+ лет, JS (Native / jQuery) 7+ лет , MySQL 3+ лет, NoSQL / MongoDB 1+ лет, Python / Django 1+ лет, Ruby / Rails 6+ месяцев, .NET MVC, HTML / DHTML / XHTML / HTML5 / CSS 7+ лет.</li><li>Технологии: SOAP, OAuth, RESTful, FB Graph API, XML / XSLT / JSON / AJAX / Protobuf, Google API / Yandex API / 5+ RTB APIs.</li><li>CMS, FW и ORM: Zend, Doctrine, Slim, Django, Rails, Magento, Joomla, Wordpress, Drupal, jQuery, Cargo, Elgg, Tomato, ZenCart, OpenCart, Mantis, LiveStreet. </li><li>Участие в проектах: Blismobile.com, Clubautomation.com, OnlineAHA.org, AHALife.com, LYF.com, DealOn.com, 2buckfreight.com, 3Key.com, CrowdCloud.com, 5thfinger.com, NextCaller, Vinatic.nl, VitaminGangster.com, NOICentral.com, Kronenbourg, PalUp, AWReminders, SaikoTeam.com, GISA.by, Srochnov.ru, Agrotour.by, NPK.of.by, NiiAR.com, Lib.PSU.by, Anastasia.travel, Kurtochka.by, Gihon.by, Damco.by и другие.</li></ul><p>Образцы исходного кода можно посмотреть здесь: <a href=\"https://github.com/manti-by/M2_micro\" target=\"_blank\">https://github.com/manti-by/M2_micro</a></p>','Кратко о себе, основные сведения, профессиональные знания и навыки.',0,'','','','','','2013-01-01 15:32:50',10,'2013-04-10 14:09:44'),(3,'Synthetic','synthetic','На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))','На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))','На мой взгляд, самая сложная, но и самая интересная моя амбиент работа. Интеллектуальный и качественный саунд в дополнении к немецким и чешским военным разработкам )))',1,'MNT007','Ambient, Chillout','LAME 192kbps 44100Hz','59:40','1. Falter - Nachtflug\r\n2. H.u.v.a - Distances\r\n3. H.u.v.a. - Acces to the long fields\r\n4. Biosphere (Hia) - Gas street basin  \r\n5. Fax - Deja vu\r\n6. Telefon Tel Aviv - TTV\r\n7. Lator - B-4 talk (Promo version)\r\n8. Shuttle 358 - Floops\r\n9. Solarise speek\r\n10. Vladislav Delay - He lived deeply  \r\n11. Monolake - Indigo    ','2007-09-16 00:00:00',11,'2013-04-10 11:48:59'),(4,'Plastic toy','plastic-toy','Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.','Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.','Третий микс из серии \"light synthetic compilation\". Смесь амбиента, нойза и даб техно!!! Многие из треков связаны \"по-три\", тем самым усложняя и украшая \"шумовую\" картину. Сет для любителей ненапряжных битов и шумов, все медлено и запутанно.',1,'MNT017','Ambient, Chillout','LAME 320kbps 44100Hz','49:01','1. Biosphere - Kobresia\r\n2. Lowtec - A2 untitled\r\n3. I/dex - Drafts\r\n4. Pole-3 - Rondell zwei\r\n5. Minilogue - Stations II\r\n6. Ike - Cluster funk\r\n7. Intrusion - Tswana dub (Brendon Moeller vs Beat Pharmacy dub)\r\n8. Harmash - Hibernatoria08\r\n9. Apparat - Wooden (Anders Ilar remix)\r\n10. Minilogue - City lights\r\n11. Dolby - He0r\r\n12. Harmash - Hibernatoria05\r\n13. Minilogue - Cow, crickets and clay','2009-05-07 00:00:00',4,'2013-04-10 11:49:09'),(5,'Solaris','solaris','Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. По традиции сет построен по любимой схеме \"два+три\" (одновременно звучит более двух треков), тем самым усложняя и украшая \"шумовую\" картину.','Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. По традиции сет построен по любимой схеме \"два+три\" (одновременно звучит более двух треков), тем самым усложняя и украшая \"шумовую\" картину.\r\nСет так назван не случайно, интро  - саундтрек к голливудской версии фильма \"Солярис\". Я очень долго его искал, но все-таки нашел. \r\nСлушайте, медитируйте, наслаждайтесь... ','Четвертый микс из серии \"light synthetic compilation\". Почти год я собирал и отфильтровывал материал с \"исключительным\" звучанием. ',1,'MNT021','Ambient, Chillout','LAME 320kbps 44100Hz','52:44','1. Cliff Martinez - We don\'t have to think like that anymore\r\n2. Cliff Martinez - First sleep\r\n3. Alva Noto - Xerrox monophaser 1\r\n4. Indo - Pneuma\r\n5. Avec.Berre - Stepdrop\r\n6. Ilpo Vaisanen - Autioitu 1\r\n7. Kassian Troyer - Plant shift\r\n8. Valliam – In samsara\r\n9. Clint Mansell - Stay with me\r\n10. Astrum - Saturn\r\n11. Pinch meets Pavel Ambiont - Poison/Remedy\r\n12. Alva Noto - Xerrox phaser acat 1','2010-04-18 00:00:00',7,'2013-04-10 11:49:11'),(6,'Stockholm syndrome','stockholm-syndrome','Очень не стандартный для меня микс, как по компиляции, так и по технике. Специально не затачивался по мое ДР, но так уж получилось, что микс был закончен именно в этот день, знаменательно.','Очень не стандартный для меня микс, как по компиляции, так и по технике. Специально не затачивался по мое ДР, но так уж получилось, что микс был закончен именно в этот день, знаменательно.\r\nВоодушевила меня на создание такого микса команда GusGus, так что любителям их творчества посвящается...','Очень не стандартный для меня микс, как по компиляции, так и по технике',1,'MNT031','Tech House, Deep House','LAME 320kbps 44100Hz','1:18:34','0. Intro - Crimea\r\n1. Tube & Berger - Come Together (Original Mix)\r\n2. Markus Fix - I\'ll House You (Original Mix)\r\n3. Tiefschwarz feat. Cassy - Find me\r\n4. Oxia - Housewife (feat. Miss Kittin)\r\n5. Royksopp - Tricky Tricky (Beyond Deep remix)\r\n6. Aki Bergen - Dont call me artist\r\n7. Sian - East of eden (Original mix)\r\n8. Popsled and Magit Cacoon - Higher point (Original mix)\r\n9. Oxia, Simon Mattson - Harmonie (Simon Mattson Remix)\r\n10. Dusty Kid - Cowboys\r\n11. Swayzak - Make up your mind\r\n12. Terry Lee Brown Junior - Bohemian life\r\n13. Agoria, Carl Craig and La Scalars - Speechless (Radio Slave remix)','2012-09-09 00:00:00',3,'2013-04-05 11:34:34'),(8,'Autoreply promo','autoreply','Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя, хотя и записался довольно спонтанно.','Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя, хотя и записался довольно спонтанно.','Весенний промо микс на тему дип хауза. Очень долгожданный микс для меня, после длительного драмового запоя.',1,'MNT027','Deep House','LAME 320kbps 44100Hz','58:54','0. Intro - Tokyo\r\n1. Fish Go Deep - Deep like\r\n2. Brawther - Spaceman funk (Deep club mix)\r\n3. Ion Ludwig - L\'Sable\r\n4. Dublee - Touch (Sweetbutter mix)\r\n5. Oscar Barila and Maiki - Above the clouds\r\n6. Ben Rourke - Tahiti\r\n7. Nikola Gala - I don\'t stop\r\n8. The Timewriter - Superschall (M.In remix)\r\n9. Oscar Barila - Tampa\r\n10. Jussi Pekka - Stream horse (Motorcitysoul remix)\r\n11. Thomas Bjerring - Republique','2012-05-02 00:00:00',4,'2013-04-11 12:07:35'),(9,'Katana','katana','Этот сет является очень чистой эссенцией техничного драма. Компилился долго и упорно, в итоге получилось довольно качественно.','Этот сет является очень чистой эссенцией техничного драма. Компилился долго и упорно, в итоге получилось довольно качественно.','Этот сет является очень чистой эссенцией техничного драма.',1,'MNT025','Techstep, Neurostep','LAME 320kbps 44100Hz','57:32','0. Sunchase - Asphalt\r\n1. Amoss - Flex\r\n2. Alix Perez - Behind time\r\n3. Trinity - Harvester\r\n4. Paperclip - Blueprints\r\n5. Enei - No Fear (feat. Riya)\r\n6 Need for mirrors - Skip rope\r\n7. Enei - Cracker (Jubei remix)\r\n8. Optiv & BTK - Inception\r\n9. Ulterior Motive - Seven Segments\r\n10. Dub Phizix - Four (feat. Skeptical)\r\n11. Nickbee - Carpe diem\r\n12. Malk - My crazy baby\r\n13. Parhelia - Spaceship named Andromeda','2011-12-05 00:00:00',6,'2013-04-05 07:40:11'),(10,'Дом разбитых сердец, начало','hobh-one','Для всех тех, кто страдает...','Для всех тех, кто страдает...','Для всех тех, кто страдает...',1,'MNT003','Ambient, Lounge','LAME 192kbps 44100Hz','64:54','1. Telepopmusik - 6p_6q_=h_4n\r\n2. Amon Tobin - Mighty micro people\r\n3. Manmademan - Breeze\r\n4. Nuclear Ramjet - Near earth project\r\n5. Telefon Tel Aviv - When it happens, it moves all by itself\r\n6. Imogen Heap - Hide & seek \r\n7. Halou - Ill carri you\r\n8. marco_manti - Music for Lilou \r\n9. Linkin Park - My December (Alter-Native mastering) \r\n10. switch (depeche mode)\r\n11. Junkie XL - We become one\r\n12. Planet Funk feat. Sally Doherty - Dusk\r\n13. 2Raumwohnung - Wir erinnern uns nicht\r\n14. Daft Punk - Something about us\r\n15. A-ha - Summer moved on','2006-12-11 00:00:00',3,'2013-04-05 20:19:28'),(11,'Дом разбитых сердец II, пепел','hobh-two','Вторая часть работы под общим названием \"Дом разбитых сердец\". Главная особенность данной компиляции в том, что абсолютно все треки - музыка \"наших\" исполнителей, это можно без труда заметить по треклисту. Вся музыка собиралась годами и тщательно фильтровалась. ','Вторая часть работы под общим названием \"Дом разбитых сердец\". Главная особенность данной компиляции в том, что абсолютно все треки - музыка \"наших\" исполнителей, это можно без труда заметить по треклисту. Вся музыка собиралась годами и тщательно фильтровалась. ','Вторая часть работы под общим названием \"Дом разбитых сердец\".',1,'MNT015','Indie, Lounge ','LAME 320kbps 44100Hz','60:32','1. Tokio - Когда ты плачешь \r\n2. Дельфин - Весна\r\n3. Без билета - Ромашка\r\n4. Земфира - Прости меня моя любовь\r\n5. Гришковец - Извини\r\n6. Ленинград - У меня есть все\r\n7. Грин грей - Осень\r\n8. 5\'nizza - Сюрная\r\n9. Океан ельзи - Вiдпусти\r\n10. Дельфин - Любовь\r\n11. T9 - Ода нашей любви\r\n12. Party makers - Новая любовь\r\n13. Нагано - Голос андеграунда\r\n14. Krec - Искра','2009-02-23 00:00:00',3,'2013-04-05 07:43:41'),(12,'Дом разбитых сердец III, такая Lite','hobh-three','Только тогда рождаются такие сеты, когда по-настоящему больно...','Только тогда рождаются такие сеты, когда по-настоящему больно...','Только тогда рождаются такие сеты, когда по-настоящему больно...',1,'MNT019','Rock, Alternative','LAME 320kbps 44100Hz','58:25','1. Radiohead - Street spirit\r\n2. Blink 182 - I miss you\r\n3. Khoiba - That reason\r\n4. Royksopp - Vision one \r\n5. Planet Funk - Ultraviolet days\r\n6. Depeche Mode - Freelove\r\n7. Red Hot Chili Peppers - Scar tissue\r\n8. Coldplay - Clocks\r\n9. Sum 41 - Pieces\r\n10. Three Days Grays - Home\r\n11. Linkin Park - In the end\r\n12. The Cardigans - Erase and rewind\r\n13. Air - How does it make you feel','2009-10-14 00:00:00',2,'2013-04-06 03:30:31'),(13,'Дом разбитых сердец 4, южные сны','hobh-four','Опять с разбитым сердцем, опять все болит, ноет и плачет… Не собирался компиляцию эту выпускать, по крайней мере так быстро, но так уж сошлись звезды.','Опять с разбитым сердцем, опять все болит, ноет и плачет… Не собирался компиляцию эту выпускать, по крайней мере так быстро, но так уж сошлись звезды, да и много чего накипело, поэтому высказался так, как смог. Многое мне очень близко в этих словах: «кое что между строк, кое что в кавычках». Спасибо парням, которые их пишут. Не относитесь серьезно к качеству, технике и другим бездушным параметрам, просто слушайте, если вам это близко.','Опять с разбитым сердцем, опять все болит, ноет и плачет… ',1,'MNT022','Hip-Hop','LAME 320kbps 44100Hz','43:12','1. Guf feat. Princip – Заходит луна\r\n2. Баста – Любовь без памяти\r\n3. Krec feat. Maestro A-Sid – Весна\r\n4. Каста – Встреча\r\n5. Смоки Мо – Герман и Патрик\r\n6. Дельфин – Надежда\r\n7. Guf feat. Ба – Дома\r\n8. Krec – Другие берега\r\n9. Лельфин – Любовь\r\n10. Михей и Джуманжи – Сука любовь\r\n11. Krec – Южные сны','2010-05-18 00:00:00',7,'2013-04-05 07:42:33'),(14,'Для клубных промоутеров','for-promouters','Родился и вырос в г.Новополоцке (Беларусь). Сейчас живу в Минске.\r\nЗакончил музыкальную школу по классу фортепиано (11 лет!!!). Из них 6 лет отбомбил в ударной группе духового оркестра.','<img src=\"/content/images/cut.jpg\" style=\"margin: 0 0 10px 10px\" class=\"fr\" alt=\"Manti\" /><p><i>Я творю только тогда, когда приходит муза. Если сидеть и специально выдавливать из себя, то и результат получится соответствующий...</i></p><br /><p>Я родился и вырос в СССР, г.Новополоцк (Беларусь). Сейчас живу в Минске.</p><p>Закончил музыкальную школу по классу фортепиано (11 лет!!!). Из них 6 лет отбомбил в ударной группе духового оркестра.</p><p>Потом университет ПГУ, программное обеспечение информационных и интернет технологий, т.е. я - Программист, чем и зарабатываю себе на жизнь.</p><p>Интерес к музыке возник где-то в году \'98. Сначала это было как у большинства моих друзей - децл))), дельфин и земфира, а потом меня понесло в другую от всех сторону - freestylers, bonfunk mc\'s, потом the prodigy, scooter, chemical brothers и т.д.</p><p>По сути люблю deep, noise, drum, minimal и еще кучу других направлений и стилей, также и играю, почти все, что нравится.</p><p>Поворотные музыкальные моменты в жизни - Richie Hawtin, потом Lator, а с утра Слава Финист. Отсюда и началась эпопея с теч хаузом и минималом. Немаловажными в формировании вкуса были поездки на КаZАнтип в \'05 и \'06 годах. </p><p>Позже был лес, Olien, Goa Gil - так я познакомился и заинтересовался психоделикой. После чего и родился двойник Janaca Express, который в последствии был \"вживую\" сыгран в клубе ХХ век. </p><p>Долгое время очень интересовал драм, а точнее techstep, neurofunk и darkstep. Два основных фактора, повлиявших на это - первых 56 релизов лэйбла \"Subtitles\" и творчество монстра даркстепа - Current Value. На данный момент это направление не потеряно, а лишь развивается по своей тонкой линии.</p><p>Последние годы стал все больше возвращаться к хаузу и его техничному направлению вместе с исконным техно и минималом. Благодаря этому, собралась уже небольшая коллекция винила, также этому способствовало появление виниловых проигрывателей.</p><p>На новый 12-й год сделал себе подарок - собрал комплект трактора, чему был несказанно рад. Сейчас и использую преимущественно его.</p><p><strong>Люблю</strong>: Виниловые пластинки, рупорный аналоговый звук, полноформатные фотоаппараты, Sony и Adidas.</p><p><strong>Ненавижу</strong>: Телефон и беспорядок.</p><p><strong>Рекомендую</strong>: Стивен Содерберг, Трудности перевода.</p><p><strong>Интересуюсь</strong>: Музыка, акустика, фотография, космос, World of Tanks.</p><p><strong>Знаю</strong>: Несколько языков программирования, нотную грамоту и сольфеджио.</p><p><strong>Умею</strong>: Есть два понятия - хочу и мне лень, а про то что я не умею пока, мне расскажет гугл.</p>','Родился и вырос в г.Новополоцке (Беларусь). Сейчас живу в Минске.\r\nЗакончил музыкальную школу по классу фортепиано (11 лет!!!).',0,'','','','','','2013-01-01 15:32:50',16,'2013-04-10 14:09:56'),(16,'Правила и Копирайт','copyrights','При использовании материалов с данного сайта, обязательна ссылка на сайт, автора и первоисточник!','<p><strong>При использовании материалов с данного сайта, обязательна ссылка на сайт, автора и первоисточник!</strong></p><p>Информация для правообладателей</p><p>Если Вы являетесь правообладателем какого-либо материала, ссылка (либо ссылки) на который размещена на этом сайте, и не хотели бы чтобы данная информация распространялась пользователями без Вашего на то согласия, то мы будем рады оказать Вам содействие, удалив соответствующие ссылки.</p><p>Для этого необходимо, чтобы вы прислали нам письмо (в электронном виде) в котором указали нам следующую информацию:<ol><li>Документальное подтверждение ваших прав на материал, защищенный авторским правом:<ul><li>Отсканированный документ с печатью, либо</li><li>Email с официального почтового домена компании правообладателя, либо</li><li>Иная контактная информация, позволяющая однозначно идентифицировать вас, как правообладателя данного материала.<li></ul></li><li>Текст который Вы желаете разместить в сопровождении удаляемой информации. В нем вы можете указать где, и на каких условиях можно получить информацию, ссылки на которую были удалены, а так же ваши контактные данные, для того чтобы пользователи могли получить от вас всю интересующую их информацию относительно данного материала.</li><li>Прямые ссылки на страницы сайта, которые содержат ссылки на данные, которые необходимо удалить. Ссылки должны иметь вид http://manti.by/xxxx/xx/xx либо подобный.</li></ol><p>После этого, в течении 48 часов, мы удалим интересующие Вас ссылки с сайта.</p><p><strong>ВНИМАНИЕ!!!</strong></p><p>Мы оставляем за собой право публикации на сайте любой информации прис