спасибо.','Сет записан специально для программы BASSTECH (<a href=\"http://novoeradio.by/basstech\">novoeradio.by/basstech</a>). Все треки сведены \"вживую\" в гостях у Ильи (Dj Hotei), за что ему большое спасибо.\r\n\r\nПеределки: до – подправил трек \"Im gonna bite you\", заменил конец и перенес его в середину, и подправил трек \"GITS\", приклеив в начале и в конце ОРИГИНАЛЬНЫЙ саундтрек к аниме \"Ghost in the shell\"; после записи единственным усовершенствованием был мастеринг (Izotope Ozone, L2).\r\n\r\nПрактически все треки представляют собой классический нейрофанк, часть треков европейский (Noisia, Spor), часть российский (Marqus, Paperclip).','Сет записан специально для программы BASSTECH (novoeradio.by/basstech). Все треки сведены \"вживую\" в гостях у Ильи (Dj Hotei), за что ему большое спасибо.',1,'MNT018','Neurofunk, Technoid','LAME 320kbps 44100Hz','58:42','1. Engage - Im gonna bite you\r\n2. Marqus - Angel  \r\n3. Bes & Flame - Eurofunk  \r\n4. Noisia - Exorcism\r\n5. Skynet - Carbon shock (Noisia remix)      \r\n6. Noisia - Block control  \r\n7. Hightech - GITS  \r\n8. Marqus - Mirage  \r\n9. Paperclip - Shogun  \r\n10. Paperclip - Bearing death  \r\n11. Spor - Supernova  \r\n12. Noisia, Maldini and Vegas - Meditation\r\n13. Quadrant - Rage and rapture  ','2009-05-21 00:00:00',5,'2013-04-06 02:01:49'),(19,'Mix for Basstech part 2','basstech-2','Второй выход на программе BASSTECH (novoeradio.by/basstech). Все треки сведены \"вживую\", правда на скорую руку, поэтому немного пострадало качество, но тем не менее сет есть и его можно слушать. ','Второй выход на программе BASSTECH (<a href=\"http://novoeradio.by/basstech\">novoeradio.by/basstech</a>). Все треки сведены \"вживую\", правда на скорую руку, поэтому немного пострадало качество, но тем не менее сет есть и его можно слушать. \r\n\r\nБольшинство треков \"отечественного\" производителя, представляющие собой Русский нейрофанк, от диповых и лайтовых направлений, до самых жирных и безкомпромисных. Есть 