/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `GET_FILES`(IN `_type` varchar(32), IN `_limit` int)
BEGIN
    SET @type = _type;
    SET @rows = _limit;
		
    IF _type <> '' THEN
			PREPARE stmt FROM "
				SELECT `id`, `type`, `name`, `description`, `source`, `size`, `md5`, `viewed`, `timestamp`
				FROM `files`
				WHERE `type` = ?
				ORDER BY `source`
				LIMIT ?;";

			EXECUTE stmt USING @type, @rows;
    ELSE
			PREPARE stmt FROM "
				SELECT `id`, `type`, `name`, `description`, `source`, `size`, `md5`, `viewed`, `timestamp`
				FROM `files`
				ORDER BY `source`
				LIMIT ?;";
      
      EXECUTE stmt USING @rows;
    END IF;	
END */;;
